import react from "react";
import "../stylesheets/App.scss";
import CardList from "./CardList";

const App = (props) => {
  return (
    <div className="App">
      <h1 className="title"> Encuentra las Parejas</h1>
      <CardList />
    </div>
  );
};

export default App;
